///   <Description>\n///     Repeats a string.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$multiplier\" type=\"int\" required=\"true\" typeLink=\"/docs/php/types/int\">\n///     Number of repeats.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function str_repeat($string, $multiplier) {\n    if (func_num_args() !== 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $times = (int)$multiplier;\n    if ($times <= 0) {\n        return '';\n    }\n\n    $value = '' . $string;\n    $out = '';\n    for ($i = 0; $i < $times; $i += 1) {\n        $out .= $value;\n    }\n    return $out;\n}\n","/php_modules/string/str_replace.phpx":"import { __deka_slice_bytes, __deka_strlen_bytes, __deka_strpos_bytes, __deka_to_lower_ascii } from './bytes_utils.phpx';\n\n/// docid: php/string/str_replace()\n/// <Function name=\"str_replace\">\n///   <Description>\n///     Replaces all occurrences of the search string with the replacement string.\n///   </Description>\n///   <Parameter name=\"$search\" type=\"string|array\" required=\"true\" typeLink=\"/docs/php/types/mixed\">\n///     The value being searched for.\n///   </Parameter>\n///   <Parameter name=\"$replace\" type=\"string|array\" required=\"true\" typeLink=\"/docs/php/types/mixed\">\n///     The replacement value.\n///   </Parameter>\n///   <Parameter name=\"$subject\" type=\"string|array\" required=\"true\" typeLink=\"/docs/php/types/mixed\">\n///     The subject string or array.\n///   </Parameter>\n///   <Parameter name=\"$count\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     Number of replacements performed.\n///   </Parameter>\n///   <ReturnType type=\"string|array\" typeLink=\"/docs/php/types/mixed\" />\n/// </Function>\nexport function str_replace($search, $replace, $subject, &$count = null) {\n    $argc = func_num_args();\n    if ($argc < 3 || $argc > 4) {\n        return null;\n    }\n\n    $total = 0;\n    $result = __deka_replace_dispatch($search, $replace, $subject, false, $total);\n    if ($argc === 4) {\n        $count = $total;\n    }\n    return $result;\n}\n\nfunction __deka_replace_dispatch($search, $replace, $subject, $caseInsensitive, &$count) {\n    $searchList = is_array($search) ? $search : [$search];\n    $replaceList = is_array($replace) ? $replace : null;\n    $replaceScalar = is_array($replace) ? null : $replace;\n\n    if (is_array($subject)) {\n        $out = [];\n        foreach ($subject as $key => $value) {\n            $out[$key] = __deka_replace_in_string(\n                '' . $value,\n                $searchList,\n                $replaceList,\n                $replaceScalar,\n                $caseInsensitive,\n                $count\n            );\n        }\n        return $out;\n    }\n\n    return __deka_replace_in_string(\n        '' . $subject,\n        $searchList,\n        $replaceList,\n        $replaceScalar,\n        $caseInsensitive,\n        $count\n    );\n}\n\nfunction __deka_replace_in_string($subject, $searchList, $replaceList, $replaceScalar, $caseInsensitive, &$count) {\n    $out = $subject;\n    $index = 0;\n    foreach ($searchList as $search) {\n        $rep = $replaceScalar !== null ? $replaceScalar : (isset($replaceList[$index]) ? $replaceList[$index] : '');\n        $out = __deka_replace_single($out, '' . $search, '' . $rep, $caseInsensitive, $count);\n        $index += 1;\n    }\n    return $out;\n}\n\nfunction __deka_replace_single($subject, $search, $replace, $caseInsensitive, &$count) {\n    if ($search === '') {\n        return $subject;\n    }\n    $haystack = $subject;\n    $needle = $search;\n    if ($caseInsensitive) {\n        $haystack = __deka_to_lower_ascii($haystack);\n        $needle = __deka_to_lower_ascii($needle);\n    }\n    $out = '';\n    $pos = 0;\n    $needleLen = __deka_strlen_bytes($needle);\n    $subjectLen = __deka_strlen_bytes($subject);\n    while ($pos <= $subjectLen) {\n        $found = __deka_strpos_bytes($haystack, $needle, $pos);\n        if ($found < 0) {\n            $out .= __deka_slice_bytes($subject, $pos, $subjectLen);\n            break;\n        }\n        $out .= __deka_slice_bytes($subject, $pos, $found);\n        $out .= $replace;\n        $count += 1;\n        $pos = $found + $needleLen;\n        if ($pos > $subjectLen) {\n            break;\n        }\n    }\n    return $out;\n}\n","/php_modules/string/str_rot13.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/str_rot13()\n/// <Function name=\"str_rot13\">\n///   <Description>\n///     Performs the ROT13 transformation.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function str_rot13($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $str = '' . $string;\n    $len = __deka_strlen_bytes($str);\n    if ($len === 0) {\n        return '';\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $byte = __deka_ord($str[$i]);\n        if ($byte >= 65 && $byte <= 90) {\n            $byte = (($byte - 65 + 13) % 26) + 65;\n        } else if ($byte >= 97 && $byte <= 122) {\n            $byte = (($byte - 97 + 13) % 26) + 97;\n        }\n        $out .= __deka_chr($byte);\n    }\n\n    return $out;\n}\n","/php_modules/string/str_shuffle.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/str_shuffle()\n/// <Function name=\"str_shuffle\">\n///   <Description>\n///     Randomly shuffles all characters in a string.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function str_shuffle($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $str = '' . $string;\n    $len = __deka_strlen_bytes($str);\n    if ($len <= 1) {\n        return $str;\n    }\n\n    $chars = [];\n    for ($i = 0; $i < $len; $i += 1) {\n        $chars[] = $str[$i];\n    }\n\n    for ($i = $len - 1; $i > 0; $i -= 1) {\n        $j = rand(0, $i);\n        $tmp = $chars[$i];\n        $chars[$i] = $chars[$j];\n        $chars[$j] = $tmp;\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $out .= $chars[$i];\n    }\n    return $out;\n}\n","/php_modules/string/str_split.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/str_split()\n/// <Function name=\"str_split\">\n///   <Description>\n///     Converts a string to an array.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$length\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     Chunk length.\n///   </Parameter>\n///   <ReturnType type=\"array|false\" typeLink=\"/docs/php/types/array\" />\n/// </Function>\nexport function str_split($string, $length = 1) {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $len = $argc === 2 ? (int)$length : 1;\n    if ($len < 1) {\n        return false;\n    }\n\n    $str = '' .