// docid: phpx/framework/set_request_context()\n/// <Function name=\"set_request_context\">\n///   <Description>PHPX standard module function `set_request_context` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function set_request_context($ctx) {\n  $store = to_assoc($ctx)\n  $GLOBALS['__framework_request_context_store'] = $store\n  return $GLOBALS['__framework_request_context_store']\n}\n\n/// docid: phpx/framework/request_context()\n/// <Function name=\"request_context\">\n///   <Description>PHPX standard module function `request_context` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function request_context() {\n  $store = &__framework_request_context_store()\n  return $GLOBALS['__framework_request_context_store']\n}\n\n/// docid: phpx/framework/clear_request_context()\n/// <Function name=\"clear_request_context\">\n///   <Description>PHPX standard module function `clear_request_context` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function clear_request_context() {\n  $store = &__framework_request_context_store()\n  $GLOBALS['__framework_request_context_store'] = []\n  return true\n}\n\n/// docid: phpx/framework/auth()\n/// <Function name=\"auth\">\n///   <Description>PHPX standard module function `auth` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function auth() {\n  $ctx = request_context()\n  if (array_key_exists('auth', $ctx)) {\n    $auth_data = to_assoc($ctx['auth'])\n    if (count($auth_data) > 0) {\n      return result_ok($auth_data)\n    }\n  }\n  return result_err('auth missing')\n}\n\n/// docid: phpx/framework/requireAuth()\n/// <Function name=\"requireAuth\">\n///   <Description>PHPX standard module function `requireAuth` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function requireAuth() {\n  $res = auth()\n  if (!result_is_ok($res)) {\n    return result_err('unauthorized')\n  }\n  $auth_data = $res->value\n  $user_id = array_key_exists('user_id', $auth_data) ? $auth_data['user_id'] : null\n  if ($user_id === null || $user_id === '') {\n    return result_err('unauthorized')\n  }\n  return result_ok($auth_data)\n}\n\n/// docid: phpx/framework/requireScope()\n/// <Function name=\"requireScope\">\n///   <Description>PHPX standard module function `requireScope` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function requireScope($scope) {\n  $required = '' . $scope\n  $auth_res = requireAuth()\n  if (!result_is_ok($auth_res)) {\n    return $auth_res\n  }\n  $auth_data = $auth_res->value\n  $scopes = array_key_exists('scopes', $auth_data) && is_array($auth_data['scopes']) ? $auth_data['scopes'] : []\n  if (in_array($required, $scopes, true)) {\n    return result_ok($auth_data)\n  }\n  return result_err('forbidden: missing scope ' . $required)\n}\n\n/// docid: phpx/framework/auth_snapshot()\n/// <Function name=\"auth_snapshot\">\n///   <Description>PHPX standard module function `auth_snapshot` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function auth_snapshot($auth_input) {\n  $src = is_array($auth_input) ? $auth_input : (array) $auth_input\n  $allowed = ['user_id', 'handle', 'scopes', 'org_id', 'session_id']\n  $out = []\n  foreach ($allowed as $key) {\n    if (array_key_exists($key, $src)) {\n      $out[$key] = $src[$key]\n    }\n  }\n  return $out\n}\n\n/// docid: phpx/framework/createRequestContext()\n/// <Function name=\"createRequestContext\">\n///   <Description>PHPX standard module function `createRequestContext` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function createRequestContext($default = null) {\n  return createContext($default)\n}\n\n/// docid: phpx/framework/RequestContextProvider()\n/// <Function name=\"RequestContextProvider\">\n///   <Description>PHPX standard module function `RequestContextProvider` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function RequestContextProvider($props) {\n  return ContextProvider($props)\n}\n\n/// docid: phpx/framework/useContext()\n/// <Function name=\"useContext\">\n///   <Description>PHPX standard module function `useContext` from `framework`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function useContext($ctx) {\n  return component_use_context($ctx)\n}\n","/__global/php_modules/fs/index.phpx":"import { result_ok, result_err, result_is_ok } from 'core/result'\nimport { bridge } from 'core/bridge'\nimport { bytes_from_array, bytes_to_array } from 'core/bytes'\n\nfunction to_assoc($value) {\n    if (is_array($value)) {\n        $out = []\n        $is_entries = true\n        foreach ($value as $entry) {\n            if (!is_array($entry) || count($entry) !== 2 || !is_string($entry[0])) {\n                $is_entries = false\n                break\n            }\n            $out[$entry[0]] = $entry[1]\n        }\n        if ($is_entries) {\n            return $out\n        }\n        return $value\n    }\n    if (is_object($value)) {\n        return (array) $value\n    }\n    if (gettype($value) === 'object') {\n        return (array) $value\n    }\n    return null\n}\n\nfunction normalize_result($raw) {\n    $assoc = to_assoc($raw)\n    if (is_array($assoc) && array_key_exists('ok', $assoc)) {\n        if ($assoc['ok']) {\n            return result_ok($assoc)\n        }\n        return result_err(array_key_exists('error', $assoc) ? $assoc['error'] : 'fs error')\n    }\n    return result_err('invalid fs response')\n}\n\n/// docid: phpx/fs/openSync()\n/// <Function name=\"openSync\">\n///   <Description>PHPX standard module function `openSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function openSync($path, $mode = 'r') {\n    $raw = bridge('fs', 'open', { path: $path, mode: $mode })\n    $res = normalize_result($raw)\n    if (!result_is_ok($res)) {\n        return $res\n    }\n    $value = to_assoc($res->value)\n    if (is_array($value) && array_key_exists('handle', $value)) {\n        return result_ok($value['handle'])\n    }\n    return result_err('open succeeded without handle')\n}\n\n/// docid: phpx/fs/readSync()\n/// <Function name=\"readSync\">\n///   <Description>PHPX standard module function `readSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function readSync($handle, $max_bytes = 65536) {\n    $raw = bridge('fs', 'read', { handle: $handle, max_bytes: $max_bytes })\n    $res = normalize_result($raw)\n    if (!result_is_ok($res)) {\n        return $res\n    }\n    $value = to_assoc($res->value)\n    if (is_array($value)) {\n        $data = array_key_exists('data', $value) ? $value['data'] : []\n        $eof = array_key_exists('eof', $value) ? $value['eof'] : false\n        if (is_array($data)) {\n            return result_ok({\n                data: bytes_from_array($data),\n                eof: $eof\n            })\n        }\n        return result_ok({\n            data: $data,\n            eof: $eof\n        })\n    }\n    return result_err('read returned invalid payload')\n}\n\n/// docid: phpx/fs/writeSync()\n/// <Function name=\"writeSync\">\n///   <Description>PHPX standard module function `writeSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function writeSync($handle, $bytes) {\n    $arr = bytes_to_array($bytes)\n    $raw = bridge('fs', 'write', { handle: $handle, data: $arr })\n    return normalize_result($raw)\n}\n\n/// docid: phpx/fs/closeSync()\n/// <Function name=\"closeSync\">\n///   <Description>PHPX standard module function `closeSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function closeSync($handle) {\n    $raw = bridge('fs', 'close', { handle: $handle })\n    return normalize_result($raw)\n}\n\n/// docid: phpx/fs/readFileSync()\n/// <Function name=\"readFileSync\">\n///   <Description>PHPX standard module function `readFileSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function readFileSync($path) {\n    $raw = bridge('fs', 'read_file', { path: $path })\n    $res = normalize_result($raw)\n    if (!result_is_ok($res)) {\n        return $res\n    }\n    $value = to_assoc($res->value)\n    if (is_array($value) && array_key_exists('data', $value)) {\n        $data = $value['data']\n        if (is_array($data)) {\n            return result_ok(bytes_from_array($data))\n        }\n        return result_ok($data)\n    }\n    return result_err('read_file returned invalid payload')\n}\n\n/// docid: phpx/fs/writeFileSync()\n/// <Function name=\"writeFileSync\">\n///   <Description>PHPX standard module function `writeFileSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function writeFileSync($path, $bytes) {\n    $arr = bytes_to_array($bytes)\n    $raw = bridge('fs', 'write_file', { path: $path, data: $arr })\n    return normalize_result($raw)\n}\n\n/// docid: phpx/fs/open()\n/// <Function name=\"open\">\n///   <Description>PHPX standard module function `open` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function open($path, $mode = 'r') {\n    return openSync($path, $mode)\n}\n\n/// docid: phpx/fs/read()\n/// <Function name=\"read\">\n///   <Description>PHPX standard module function `read` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function read($handle, $max_bytes = 65536) {\n    return readSync($handle, $max_bytes)\n}\n\n/// docid: phpx/fs/write()\n/// <Function name=\"write\">\n///   <Description>PHPX standard module function `write` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function write($handle, $bytes) {\n    return writeSync($handle, $bytes)\n}\n\n/// docid: phpx/fs/close()\n/// <Function name=\"close\">\n///   <Description>PHPX standard module function `close` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function close($handle) {\n    return closeSync($handle)\n}\n\n/// docid: phpx/fs/readFile()\n/// <Function name=\"readFile\">\n///   <Description>PHPX standard module function `readFile` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function readFile($path) {\n    return readFileSync($path)\n}\n\n/// docid: phpx/fs/writeFile()\n/// <Function name=\"writeFile\">\n///   <Description>PHPX standard module function `writeFile` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function writeFile($path, $bytes) {\n    return writeFileSync($path, $bytes)\n}\n\n// Backward compatibility aliases.\n/// docid: phpx/fs/read_file()\n/// <Function name=\"read_file\">\n///   <Description>PHPX standard module function `read_file` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function read_file($path) {\n    return readFileSync($path)\n}\n\n/// docid: phpx/fs/write_file()\n/// <Function name=\"write_file\">\n///   <Description>PHPX standard module function `write_file` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function write_file($path, $bytes) {\n    return writeFileSync($path, $bytes)\n}\n\n/// docid: phpx/fs/readDirSync()\n/// <Function name=\"readDirSync\">\n///   <Description>PHPX standard module function `readDirSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function readDirSync($path) {\n    $raw = bridge('fs', 'read_dir', { path: $path, with_types: true })\n    $res = normalize_result($raw)\n    if (!result_is_ok($res)) {\n        return $res\n    }\n    $value = to_assoc($res->value)\n    if (is_array($value) && array_key_exists('entries', $value)) {\n        $entries = $value['entries']\n        if (is_array($entries)) {\n            return result_ok($entries)\n        }\n    }\n    return result_err('read_dir returned invalid payload')\n}\n\n/// docid: phpx/fs/readDir()\n/// <Function name=\"readDir\">\n///   <Description>PHPX standard module function `readDir` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function readDir($path) {\n    return readDirSync($path)\n}\n\n/// docid: phpx/fs/mkdirSync()\n/// <Function name=\"mkdirSync\">\n///   <Description>PHPX standard module function `mkdirSync` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function mkdirSync($path) {\n    $raw = bridge('fs', 'mkdirs', { path: $path })\n    return normalize_result($raw)\n}\n\n/// docid: phpx/fs/mkdir()\n/// <Function name=\"mkdir\">\n///   <Description>PHPX standard module function `mkdir` from `fs`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function mkdir($path) {\n    return mkdirSync($path)\n}\n","/__global/php_modules/fs/module.d.phpx":"import { Result } from 'core/result'\n\nexport function open($path: string, $mode: string = 'r'): Promise<Result<int, string>>\nexport function read($handle: int, $max_bytes: int = 65536): Promise<Result<Object<{ data: mixed, eof: bool }>, string>>\nexport function write($handle: int, $bytes: mixed): Promise<Result<Object<{ written: int }>, string>>\nexport function close($handle: int): Promise<Result<Object<{ ok: bool }>, string>>\nexport function readFile($path: string): Promise<Result<mixed, string>>\nexport function writeFile($path: string, $bytes: mixed): Promise<Result<Object<{ written: int }>, string>>\n\nexport function openSync($path: string, $mode: string = 'r'): Result<int, string>\nexport function readSync($handle: int, $max_bytes: int = 65536): Result<Object<{ data: mixed, eof: bool }>, string>\nexport function writeSync($handle: int, $bytes: mixed): Result<Object<{ written: int }>, string>\nexport function closeSync($handle: int): Result<Object<{ ok: bool }>, string>\nexport function readFileSync($path: string): Result<mixed, string>\nexport function writeFileSync($path: string, $bytes: mixed): Result<Object<{ written: int }>, string>\n\nexport function read_file($path: string): Result<mixed, string>\nexport function write_file($path: string, $bytes: mixed): Result<Object<{ written: int }>, string>\n","/__global/php_modules/json/index.phpx":"export {\n  json_encode,\n  json_decode,\n  json_decode_result,\n  json_last_error,\n  json_last_error_msg,\n  json_validate,\n} from 'encoding/json';\n","/__global/php_modules/jwt/index.phpx":"import { result_ok, result_err, result_is_ok } from 'core/result'\nimport { hmac_sha256_bytes, secure_compare, base64_encode_string, base64_decode_string } from 'crypto'\nimport { to_string as bytes_to_string } from 'bytes'\nimport { json_encode, json_decode_result } from 'encoding/json'\nimport { rtrim } from 'string/rtrim'\nimport { str_replace } from 'string/str_replace'\nimport { strlen } from 'string/strlen'\nimport { str_repeat } from 'string/str_repeat'\nimport { strtoupper } from 'string/strtoupper'\nimport { explode } from 'string/explode'\nimport { now_ms } from 'time'\n\nfunction to_assoc($value) {\n  if (is_array($value)) {\n    if (count($value) === 1 && array_key_exists(0, $value) && (is_object($value[0]) || is_array($value[0]))) {\n      return is_object($value[0]) ? (array) $value[0] : $value[0]\n    }\n    if (count($value) === 1 && array_key_exists('0', $value) && (is_object($value['0']) || is_array($value['0']))) {\n      return is_object($value['0']) ? (array) $value['0'] : $value['0']\n    }\n    return $value\n  }\n  if (is_object($value)) {\n    $out = (array) $value\n    if (count($out) === 1 && array_key_exists(0, $out) && (is_object($out[0]) || is_array($out[0]))) {\n      return is_object($out[0]) ? (array) $out[0] : $out[0]\n    }\n    if (count($out) === 1 && array_key_exists('0', $out) && (is_object($out['0']) || is_array($out['0']))) {\n      return is_object($out['0']) ? (array) $out['0'] : $out['0']\n    }\n    return $out\n  }\n  return []\n}\n\nfunction b64url_encode($raw) {\n  return rtrim(str_replace(['+', '/'], ['-', '_'], base64_encode_string($raw)), '=')\n}\n\nfunction b64url_decode($value) {\n  $padded = '' . $value\n  $pad = strlen($padded) % 4\n  if ($pad > 0) {\n    $padded = $padded . str_repeat('=', 4 - $pad)\n  }\n  $decoded = base64_decode_string(str_replace(['-', '_'], ['+', '/'], $padded), true)\n  if ($decoded === false) {\n    return result_err('invalid base64url payload')\n  }\n  return result_ok($decoded)\n}\n\nfunction now_unix() {\n  return (int) (now_ms() / 1000)\n}\n\nfunction normalize_claims($payload, $options = []) {\n  $claims = to_assoc($payload)\n  if (is_array($options) && array_key_exists('iss', $options)) {\n    $claims['iss'] = $options['iss']\n  }\n  if (is_array($options) && array_key_exists('aud', $options)) {\n    $claims['aud'] = $options['aud']\n  }\n  if (is_array($options) && array_key_exists('sub', $options)) {\n    $claims['sub'] = $options['sub']\n  }\n  if (!array_key_exists('iat', $claims)) {\n    $claims['iat'] = now_unix()\n  }\n  if (is_array($options) && array_key_exists('exp_in', $options)) {\n    $claims['exp'] = now_unix() + (int) $options['exp_in']\n  }\n  if (is_array($options) && array_key_exists('exp', $options)) {\n    $claims['exp'] = (int) $options['exp']\n  }\n  return $claims\n}\n\n/// docid: phpx/jwt/sign()\n/// <Function name=\"sign\">\n///   <Description>PHPX standard module function `sign` from `jwt`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function sign($payload, $secret, $options = []) {\n  $alg = is_array($options) && array_key_exists('alg', $options) ? strtoupper('' . $options['alg']) : 'HS256'\n  if ($alg !== 'HS256') {\n    return result_err('unsupported jwt alg: ' . $alg)\n  }\n\n  $header = [ 'alg' => 'HS256', 'typ' => 'JWT' ]\n  $claims = normalize_claims($payload, $options)\n  $header_json = json_encode($header)\n  $claims_json = json_encode($claims)\n  if (!is_string($header_json) || !is_string($claims_json)) {\n    return result_err('failed to encode jwt parts')\n  }\n  $input = b64url_encode($header_json) . '.' . b64url_encode($claims_json)\n  $sig = bytes_to_string(hmac_sha256_bytes($input, $secret))\n  return result_ok($input . '.' . b64url_encode($sig))\n}\n\nfunction decode_parts($token) {\n  $parts = explode('.', '' . $token)\n  if (count($parts) !== 3) {\n    return result_err('invalid jwt format')\n  }\n  $h = b64url_decode($parts[0])\n  if (!result_is_ok($h)) {\n    return $h\n  }\n  $p = b64url_decode($parts[1])\n  if (!result_is_ok($p)) {\n    return $p\n  }\n  $s = b64url_decode($parts[2])\n  if (!result_is_ok($s)) {\n    return $s\n  }\n  $header_json = $h->value\n  $payload_json = $p->value\n  $header_res = json_decode_result($header_json, true)\n  if (!result_is_ok($header_res)) {\n    return result_err('invalid jwt header json')\n  }\n  $payload_res = json_decode_result($payload_json, true)\n  if (!result_is_ok($payload_res)) {\n    return result_err('invalid jwt payload json')\n  }\n  return result_ok([\n    'header' => $header_res->value,\n    'payload' => $payload_res->value,\n    'signature_raw' => $s->value,\n    'signing_input' => $parts[0] . '.' . $parts[1],\n  ])\n}\n\nfunction validate_claims($claims, $options = []) {\n  $claims_assoc = to_assoc($claims)\n  $now = now_unix()\n  $leeway = is_array($options) && array_key_exists('leeway', $options) ? (int) $options['leeway'] : 0\n\n  if (array_key_exists('iat', $claims_assoc) && (int) $claims_assoc['iat'] - $leeway > $now) {\n    return result_err('jwt issued in future')\n  }\n\n  if (array_key_exists('exp', $claims_assoc) && (int) $claims_assoc['exp'] + $leeway < $now) {\n    return result_err('jwt expired')\n  }\n  if (array_key_exists('nbf', $claims_assoc) && (int) $claims_assoc['nbf'] - $leeway > $now) {\n    return result_err('jwt not active yet')\n  }\n  if (is_array($options) && array_key_exists('iss', $options)) {\n    if (!array_key_exists('iss', $claims_assoc) || ('' . $claims_assoc['iss']) !== ('' . $options['iss'])) {\n      return result_err('jwt issuer mismatch')\n    }\n  }\n  if (is_array($options) && array_key_exists('aud', $options)) {\n    if (!array_key_exists('aud', $claims_assoc) || ('' . $claims_assoc['aud']) !== ('' . $options['aud'])) {\n      return result_err('jwt audience mismatch')\n    }\n  }\n  return result_ok(true)\n}\n\n/// docid: phpx/jwt/verify()\n/// <Function name=\"verify\">\n///   <Description>PHPX standard module function `verify` from `jwt`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function verify($token, $secret, $options = []) {\n  $parts_res = decode_parts($token)\n  if (!result_is_ok($parts_res)) {\n    return $parts_res\n  }\n  $parts = to_assoc($parts_res->value)\n  $header = array_key_exists('header', $parts) ? to_assoc($parts['header']) : []\n  $payload = array_key_exists('payload', $parts) ? to_assoc($parts['payload']) : []\n  if (!array_key_exists('alg', $header) || strtoupper('' . $header['alg']) !== 'HS256') {\n    return result_err('unsupported jwt alg')\n  }\n  $signing_input = array_key_exists('signing_input', $parts) ? $parts['signing_input'] : ''\n  $signature_raw = array_key_exists('signature_raw', $parts) ? $parts['signature_raw'] : ''\n  $expected_sig = bytes_to_string(hmac_sha256_bytes($signing_input, $secret))\n  if (!secure_compare($expected_sig, $signature_raw)) {\n    return result_err('invalid jwt signature')\n  }\n  $claims_check = validate_claims($payload, $options)\n  if (!result_is_ok($claims_check)) {\n    return $claims_check\n  }\n  return result_ok($payload)\n}\n","/__global/php_modules/jwt/module.d.phpx":"import { Result } from 'core/result'\n\nexport function sign($payload: mixed, $secret: mixed, $options: mixed = []): Result<string, string>\nexport function verify($token: string, $secret: mixed, $options: mixed = []): Result<mixed, string>\n","/__global/php_modules/stdlib.json":"[\n  \"core/*\",\n  \"encoding/json\",\n  \"string/*\",\n  \"array/*\"\n]\n","/__global/php_modules/string/addcslashes.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\nimport { __deka_trim_build_mask } from './trim_utils.phpx';\n\n/// docid: php/string/addcslashes()\n/// <Function name=\"addcslashes\">\n///   <Description>\n///     Quotes string with slashes in a C-style manner.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$characters\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     Character list or ranges to escape.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function addcslashes($string, $characters) {\n    if (func_num_args() !== 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n    if (is_array($characters) || is_object($characters)) {\n        return null;\n    }\n\n    $str = '' . $string;\n    $mask = __deka_trim_build_mask('' . $characters);\n    $len = __deka_strlen_bytes($str);\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $ch = $str[$i];\n        $byte = __deka_ord($ch);\n        if (!isset($mask[$byte])) {\n            $out .= $ch;\n            continue;\n        }\n\n        if ($byte === 10) {\n            $out .= '\\\\n';\n            continue;\n        }\n        if ($byte === 13) {\n            $out .= '\\\\r';\n            continue;\n        }\n        if ($byte === 9) {\n            $out .= '\\\\t';\n            continue;\n        }\n        if ($byte === 7) {\n            $out .= '\\\\a';\n            continue;\n        }\n        if ($byte === 8) {\n            $out .= '\\\\b';\n            continue;\n        }\n        if ($byte === 11) {\n            $out .= '\\\\v';\n            continue;\n        }\n        if ($byte === 12) {\n            $out .= '\\\\f';\n            continue;\n        }\n\n        if ($byte < 32 || $byte > 126) {\n            $out .= '\\\\' . __deka_oct($byte);\n            continue;\n        }\n\n        $out .= '\\\\' . $ch;\n    }\n\n    return $out;\n}\n\nfunction __deka_oct($value) {\n    $v = $value & 255;\n    $a = (int)($v / 64);\n    $b = (int)(($v % 64) / 8);\n    $c = $v % 8;\n    return '' . $a . $b . $c;\n}\n","/__global/php_modules/string/addslashes.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/addslashes()\n/// <Function name=\"addslashes\">\n///   <Description>\n///     Returns a string with backslashes added before characters that need escaping.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function addslashes($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $str = '' . $string;\n    $len = __deka_strlen_bytes($str);\n    if ($len === 0) {\n        return '';\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $ch = $str[$i];\n        if ($ch === \"'\" || $ch === '\"' || $ch === '\\\\' || $ch === \"\\0\") {\n            $out .= '\\\\';\n        }\n        $out .= $ch;\n    }\n\n    return $out;\n}\n","/__global/php_modules/string/bin2hex.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/bin2hex()\n/// <Function name=\"bin2hex\">\n///   <Description>\n///     Converts binary data into a hexadecimal string.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function bin2hex($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $str = '' . $string;\n    $len = __deka_strlen_bytes($str);\n    if ($len === 0) {\n        return '';\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $byte = __deka_ord($str[$i]);\n        $hi = ($byte >> 4) & 15;\n        $lo = $byte & 15;\n        $out .= __deka_hex_nibble($hi);\n        $out .= __deka_hex_nibble($lo);\n    }\n    return $out;\n}\n\nfunction __deka_hex_nibble($value) {\n    if ($value < 10) {\n        return __deka_chr(48 + $value);\n    }\n    return __deka_chr(87 + $value);\n}\n","/__global/php_modules/string/bytes_utils.phpx":"/// docid: phpx/string/__deka_strlen_bytes()\n/// <Function name=\"__deka_strlen_bytes\">\n///   <Description>PHPX standard module function `__deka_strlen_bytes` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_strlen_bytes($value) {\n    $len = 0;\n    while (isset($value[$len])) {\n        $len += 1;\n    }\n    return $len;\n}\n\n/// docid: phpx/string/__deka_slice_bytes()\n/// <Function name=\"__deka_slice_bytes\">\n///   <Description>PHPX standard module function `__deka_slice_bytes` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_slice_bytes($value, $start, $end) {\n    $out = '';\n    for ($i = $start; $i < $end; $i += 1) {\n        $out .= $value[$i];\n    }\n    return $out;\n}\n\n/// docid: phpx/string/__deka_substr_bytes()\n/// <Function name=\"__deka_substr_bytes\">\n///   <Description>PHPX standard module function `__deka_substr_bytes` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_substr_bytes($value, $start, $length) {\n    if ($length <= 0) {\n        return '';\n    }\n    return __deka_slice_bytes($value, $start, $start + $length);\n}\n\n/// docid: phpx/string/__deka_strpos_bytes()\n/// <Function name=\"__deka_strpos_bytes\">\n///   <Description>PHPX standard module function `__deka_strpos_bytes` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_strpos_bytes($haystack, $needle, $offset = 0) {\n    $hlen = __deka_strlen_bytes($haystack);\n    $nlen = __deka_strlen_bytes($needle);\n    if ($nlen === 0) {\n        return 0;\n    }\n\n    $start = $offset;\n    if ($start < 0) {\n        $start = $hlen + $start;\n        if ($start < 0) {\n            $start = 0;\n        }\n    }\n    if ($start > $hlen) {\n        return -1;\n    }\n\n    $last = $hlen - $nlen;\n    for ($i = $start; $i <= $last; $i += 1) {\n        $matched = true;\n        for ($j = 0; $j < $nlen; $j += 1) {\n            if ($haystack[$i + $j] !== $needle[$j]) {\n                $matched = false;\n                break;\n            }\n        }\n        if ($matched) {\n            return $i;\n        }\n    }\n    return -1;\n}\n\n/// docid: phpx/string/__deka_to_lower_ascii()\n/// <Function name=\"__deka_to_lower_ascii\">\n///   <Description>PHPX standard module function `__deka_to_lower_ascii` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_to_lower_ascii($value) {\n    $len = __deka_strlen_bytes($value);\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $byte = ord($value[$i]);\n        if ($byte >= 65 && $byte <= 90) {\n            $byte += 32;\n        }\n        $out .= chr($byte);\n    }\n    return $out;\n}\n\n/// docid: phpx/string/__deka_to_upper_ascii()\n/// <Function name=\"__deka_to_upper_ascii\">\n///   <Description>PHPX standard module function `__deka_to_upper_ascii` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_to_upper_ascii($value) {\n    $len = __deka_strlen_bytes($value);\n    $out = '';\n    for ($i = 0; $i < $len; $i += 1) {\n        $byte = ord($value[$i]);\n        if ($byte >= 97 && $byte <= 122) {\n            $byte -= 32;\n        }\n        $out .= chr($byte);\n    }\n    return $out;\n}\n","/__global/php_modules/string/chop.phpx":"import { rtrim } from './rtrim.phpx';\n\n/// docid: php/string/chop()\n/// <Function name=\"chop\">\n///   <Description>\n///     Alias of [rtrim()](/docs/php/string/rtrim()).\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$characters\" type=\"string\" required=\"false\" typeLink=\"/docs/php/types/string\">\n///     Optional character mask.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function chop($string, $characters = null) {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 2) {\n        return null;\n    }\n\n    if ($argc === 1) {\n        return rtrim($string);\n    }\n\n    return rtrim($string, $characters);\n}\n","/__global/php_modules/string/chr.phpx":"/// docid: php/string/chr()\n/// <Function name=\"chr\">\n///   <Description>\n///     Returns a one-character string from an integer codepoint (0-255).\n///   </Description>\n///   <Parameter name=\"$codepoint\" type=\"int\" required=\"true\" typeLink=\"/docs/php/types/int\">\n///     The ASCII codepoint.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function chr($codepoint) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($codepoint) || is_object($codepoint)) {\n        return null;\n    }\n\n    return __deka_chr((int)$codepoint);\n}\n","/__global/php_modules/string/chunk_split.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/chunk_split()\n/// <Function name=\"chunk_split\">\n///   <Description>\n///     Splits a string into smaller chunks.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$length\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     The chunk length.\n///   </Parameter>\n///   <Parameter name=\"$separator\" type=\"string\" required=\"false\" typeLink=\"/docs/php/types/string\">\n///     The line ending.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function chunk_split($string, $length = 76, $separator = \"\\r\\n\") {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 3) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $chunkLen = $argc >= 2 ? (int)$length : 76;\n    if ($chunkLen < 1) {\n        return null;\n    }\n\n    $sep = $argc === 3 ? ('' . $separator) : \"\\r\\n\";\n    $str = '' . $string;\n    $len = __deka_strlen_bytes($str);\n    if ($len === 0) {\n        return '';\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += $chunkLen) {\n        for ($j = 0; $j < $chunkLen && $i + $j < $len; $j += 1) {\n            $out .= $str[$i + $j];\n        }\n        $out .= $sep;\n    }\n\n    return $out;\n}\n","/__global/php_modules/string/convert_cyr_string.phpx":"/// docid: php/string/convert_cyr_string()\n/// <Function name=\"convert_cyr_string\">\n///   <Description>\n///     Converts a string from one Cyrillic encoding to another.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$from\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The source encoding letter.\n///   </Parameter>\n///   <Parameter name=\"$to\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The target encoding letter.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function convert_cyr_string($string, $from, $to) {\n    if (func_num_args() !== 3) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n    if (is_array($from) || is_object($from)) {\n        return null;\n    }\n    if (is_array($to) || is_object($to)) {\n        return null;\n    }\n\n    $input = '' . $string;\n    $fromStr = '' . $from;\n    $toStr = '' . $to;\n    if ($fromStr === '' || $toStr === '') {\n        return null;\n    }\n\n    $fromLabel = __deka_cyrillic_label($fromStr[0]);\n    $toLabel = __deka_cyrillic_label($toStr[0]);\n    if ($fromLabel === null || $toLabel === null) {\n        return null;\n    }\n    if ($fromLabel === $toLabel) {\n        return $input;\n    }\n\n    return mb_convert_encoding($input, $toLabel, $fromLabel);\n}\n\nfunction __deka_cyrillic_label($code) {\n    $byte = ord($code);\n    if ($byte >= 65 && $byte <= 90) {\n        $byte += 32;\n    }\n    switch ($byte) {\n        case 107:\n            return 'koi8-r';\n        case 119:\n            return 'windows-1251';\n        case 105:\n            return 'iso-8859-5';\n        case 97:\n        case 100:\n            return 'ibm866';\n        case 109:\n            return 'x-mac-cyrillic';\n        default:\n            return null;\n    }\n}\n","/__global/php_modules/string/convert_uudecode.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/convert_uudecode()\n/// <Function name=\"convert_uudecode\">\n///   <Description>\n///     Decodes a uuencoded string.\n///   </Description>\n///   <Parameter name=\"$data\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The uuencoded data.\n///   </Parameter>\n///   <ReturnType type=\"string|false\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function convert_uudecode($data) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($data) || is_object($data)) {\n        return null;\n    }\n\n    $input = '' . $data;\n    $len = __deka_strlen_bytes($input);\n    if ($len === 0) {\n        return false;\n    }\n\n    $out = '';\n    $i = 0;\n    while ($i < $len) {\n        $lineLen = __deka_uu_dec(ord($input[$i]));\n        $i += 1;\n        if ($lineLen === 0) {\n            break;\n        }\n\n        $written = 0;\n        while ($written < $lineLen) {\n            if ($i + 4 > $len) {\n                return false;\n            }\n            $c1 = __deka_uu_dec(ord($input[$i]));\n            $c2 = __deka_uu_dec(ord($input[$i + 1]));\n            $c3 = __deka_uu_dec(ord($input[$i + 2]));\n            $c4 = __deka_uu_dec(ord($input[$i + 3]));\n\n            $b1 = ($c1 << 2) | ($c2 >> 4);\n            $b2 = ($c2 << 4) | ($c3 >> 2);\n            $b3 = ($c3 << 6) | $c4;\n\n            $out .= chr($b1);\n            $written += 1;\n            if ($written < $lineLen) {\n                $out .= chr($b2);\n                $written += 1;\n            }\n            if ($written < $lineLen) {\n                $out .= chr($b3);\n                $written += 1;\n            }\n\n            $i += 4;\n        }\n\n        if ($i < $len && $input[$i] === \"\\n\") {\n            $i += 1;\n        }\n    }\n\n    return $out;\n}\n\nfunction __deka_uu_dec($value) {\n    return ($value - 32) & 0x3f;\n}\n","/__global/php_modules/string/convert_uuencode.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/convert_uuencode()\n/// <Function name=\"convert_uuencode\">\n///   <Description>\n///     Encodes a string using uuencode.\n///   </Description>\n///   <Parameter name=\"$data\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input data.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function convert_uuencode($data) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($data) || is_object($data)) {\n        return null;\n    }\n\n    $input = '' . $data;\n    $len = __deka_strlen_bytes($input);\n    $out = '';\n    $i = 0;\n    while ($i < $len) {\n        $chunkLen = $len - $i;\n        if ($chunkLen > 45) {\n            $chunkLen = 45;\n        }\n\n        $out .= __deka_uu_enc($chunkLen);\n        $j = 0;\n        while ($j < $chunkLen) {\n            $b1 = ord($input[$i + $j]);\n            $b2 = ($j + 1 < $chunkLen) ? ord($input[$i + $j + 1]) : 0;\n            $b3 = ($j + 2 < $chunkLen) ? ord($input[$i + $j + 2]) : 0;\n\n            $out .= __deka_uu_enc($b1 >> 2);\n            $out .= __deka_uu_enc((($b1 << 4) & 0x30) | (($b2 >> 4) & 0x0f));\n            $out .= __deka_uu_enc((($b2 << 2) & 0x3c) | (($b3 >> 6) & 0x03));\n            $out .= __deka_uu_enc($b3 & 0x3f);\n            $j += 3;\n        }\n\n        $out .= \"\\n\";\n        $i += $chunkLen;\n    }\n\n    $out .= __deka_uu_enc(0) . \"\\n\";\n    return $out;\n}\n\nfunction __deka_uu_enc($value) {\n    if ($value === 0) {\n        return '`';\n    }\n    return chr(($value & 0x3f) + 32);\n}\n","/__global/php_modules/string/count_chars.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/count_chars()\n/// <Function name=\"count_chars\">\n///   <Description>\n///     Returns information about the characters used in a string.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$mode\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     The output mode.\n///   </Parameter>\n///   <ReturnType type=\"array|string\" typeLink=\"/docs/php/types/mixed\" />\n/// </Function>\nexport function count_chars($string, $mode = 0) {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $modeValue = $argc === 2 ? (int)$mode : 0;\n    $input = '' . $string;\n    $counts = [];\n    $len = __deka_strlen_bytes($input);\n    for ($i = 0; $i < $len; $i += 1) {\n        $code = ord($input[$i]);\n        $counts[$code] = isset($counts[$code]) ? ($counts[$code] + 1) : 1;\n    }\n\n    if ($modeValue === 3 || $modeValue === 4) {\n        $out = '';\n        for ($i = 0; $i < 256; $i += 1) {\n            $present = isset($counts[$i]);\n            if (($modeValue === 3 && $present) || ($modeValue === 4 && !$present)) {\n                $out .= chr($i);\n            }\n        }\n        return $out;\n    }\n\n    $out = [];\n    for ($i = 0; $i < 256; $i += 1) {\n        $present = isset($counts[$i]);\n        if ($modeValue === 0) {\n            $out[$i] = $present ? $counts[$i] : 0;\n        } else if ($modeValue === 1) {\n            if ($present) {\n                $out[$i] = $counts[$i];\n            }\n        } else if ($modeValue === 2) {\n            if (!$present) {\n                $out[$i] = 0;\n            }\n        } else {\n            return null;\n        }\n    }\n\n    return $out;\n}\n","/__global/php_modules/string/crc32.phpx":"/// docid: php/string/crc32()\n/// <Function name=\"crc32\">\n///   <Description>\n///     Calculates the CRC32 polynomial of a string.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input data.\n///   </Parameter>\n///   <ReturnType type=\"int\" typeLink=\"/docs/php/types/int\" />\n/// </Function>\nexport function crc32($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    return __deka_crc32('' . $string);\n}\n","/__global/php_modules/string/crypt.phpx":"/// docid: php/string/crypt()\n/// <Function name=\"crypt\">\n///   <Description>\n///     One-way string hashing (platform dependent).\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$salt\" type=\"string\" required=\"false\" typeLink=\"/docs/php/types/string\">\n///     The optional salt.\n///   </Parameter>\n///   <ReturnType type=\"string|false\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function crypt($string, $salt = null) {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n    if ($argc === 2 && (is_array($salt) || is_object($salt))) {\n        return null;\n    }\n\n    if ($argc === 1) {\n        return __deka_crypt('' . $string);\n    }\n    return __deka_crypt('' . $string, '' . $salt);\n}\n","/__global/php_modules/string/explode.phpx":"import { __deka_slice_bytes, __deka_strlen_bytes, __deka_strpos_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/explode()\n/// <Function name=\"explode\">\n///   <Description>\n///     Splits a string by a separator.\n///   </Description>\n///   <Parameter name=\"$separator\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The boundary string.\n///   </Parameter>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$limit\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     Optional limit on the number of parts.\n///   </Parameter>\n///   <ReturnType type=\"array|false\" typeLink=\"/docs/php/types/array\" />\n/// </Function>\nexport function explode($separator, $string, $limit = null) {\n    $argc = func_num_args();\n    if ($argc < 2 || $argc > 3) {\n        return null;\n    }\n\n    if (is_array($separator) || is_object($separator)) {\n        return null;\n    }\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $sep = '' . $separator;\n    if ($sep === '') {\n        return false;\n    }\n    $str = '' . $string;\n\n    $limitValue = null;\n    if ($argc === 3 && $limit !== null) {\n        $limitValue = (int)$limit;\n        if ($limitValue === 0) {\n            $limitValue = 1;\n        }\n    }\n\n    $sepLen = __deka_strlen_bytes($sep);\n    $len = __deka_strlen_bytes($str);\n    $parts = [];\n    $pos = 0;\n    $count = 0;\n\n    while (true) {\n        if ($limitValue !== null && $limitValue > 0 && $count >= $limitValue - 1) {\n            $parts[] = __deka_slice_bytes($str, $pos, $len);\n            break;\n        }\n        $next = __deka_strpos_bytes($str, $sep, $pos);\n        if ($next < 0) {\n            $parts[] = __deka_slice_bytes($str, $pos, $len);\n            break;\n        }\n        $parts[] = __deka_slice_bytes($str, $pos, $next);\n        $pos = $next + $sepLen;\n        $count += 1;\n        if ($pos > $len) {\n            if ($limitValue === null || $limitValue > 0) {\n                $parts[] = '';\n            }\n            break;\n        }\n    }\n\n    if ($limitValue !== null && $limitValue < 0) {\n        $remove = -$limitValue;\n        $total = count($parts);\n        if ($remove >= $total) {\n            return [];\n        }\n        $trimmed = [];\n        for ($i = 0; $i < $total - $remove; $i += 1) {\n            $trimmed[] = $parts[$i];\n        }\n        return $trimmed;\n    }\n\n    return $parts;\n}\n","/__global/php_modules/string/fprintf.phpx":"import { __deka_format_sprintf_from_args } from './printf_utils.phpx';\n\n/// docid: php/string/fprintf()\n/// <Function name=\"fprintf\">\n///   <Description>\n///     Writes a formatted string to a stream.\n///   </Description>\n///   <Parameter name=\"$stream\" type=\"mixed\" required=\"true\" typeLink=\"/docs/php/types/mixed\">\n///     The output stream.\n///   </Parameter>\n///   <Parameter name=\"$format\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The format string.\n///   </Parameter>\n///   <Parameter name=\"$values\" type=\"mixed\" required=\"false\" typeLink=\"/docs/php/types/mixed\">\n///     Values to format.\n///   </Parameter>\n///   <ReturnType type=\"int\" typeLink=\"/docs/php/types/int\" />\n/// </Function>\nexport function fprintf($stream, $format) {\n    if (func_num_args() < 2) {\n        return null;\n    }\n\n    $args = func_get_args();\n    $formatArgs = [];\n    $argCount = count($args);\n    for ($i = 1; $i < $argCount; $i += 1) {\n        $formatArgs[] = $args[$i];\n    }\n\n    $formatted = __deka_format_sprintf_from_args($formatArgs);\n    if ($formatted === null) {\n        return null;\n    }\n    return fwrite($stream, $formatted);\n}\n","/__global/php_modules/string/hebrev.phpx":"/// docid: php/string/hebrev()\n/// <Function name=\"hebrev\">\n///   <Description>\n///     Converts logical Hebrew text to visual text.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$max_chars_per_line\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     Maximum characters per line.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function hebrev($string, $max_chars_per_line = 0) {\n    $argc = func_num_args();\n    if ($argc < 1 || $argc > 2) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    return '' . $string;\n}\n","/__global/php_modules/string/hex2bin.phpx":"import { __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: php/string/hex2bin()\n/// <Function name=\"hex2bin\">\n///   <Description>\n///     Converts a hex string into binary data.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The hex string.\n///   </Parameter>\n///   <ReturnType type=\"string|false\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function hex2bin($string) {\n    if (func_num_args() !== 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    $hex = '' . $string;\n    $len = __deka_strlen_bytes($hex);\n    if ($len === 0) {\n        return '';\n    }\n    if ($len % 2 !== 0) {\n        return false;\n    }\n\n    $out = '';\n    for ($i = 0; $i < $len; $i += 2) {\n        $hi = __deka_hex_value($hex[$i]);\n        $lo = __deka_hex_value($hex[$i + 1]);\n        if ($hi < 0 || $lo < 0) {\n            return false;\n        }\n        $out .= __deka_chr(($hi << 4) | $lo);\n    }\n    return $out;\n}\n\nfunction __deka_hex_value($ch) {\n    $byte = __deka_ord($ch);\n    if ($byte >= 48 && $byte <= 57) {\n        return $byte - 48;\n    }\n    if ($byte >= 65 && $byte <= 70) {\n        return $byte - 55;\n    }\n    if ($byte >= 97 && $byte <= 102) {\n        return $byte - 87;\n    }\n    return -1;\n}\n","/__global/php_modules/string/html_entity_decode.phpx":"import { __deka_html_unescape } from './html_utils.phpx';\n\n/// docid: php/string/html_entity_decode()\n/// <Function name=\"html_entity_decode\">\n///   <Description>\n///     Converts HTML entities to their corresponding characters.\n///   </Description>\n///   <Parameter name=\"$string\" type=\"string\" required=\"true\" typeLink=\"/docs/php/types/string\">\n///     The input string.\n///   </Parameter>\n///   <Parameter name=\"$flags\" type=\"int\" required=\"false\" typeLink=\"/docs/php/types/int\">\n///     Optional flags.\n///   </Parameter>\n///   <Parameter name=\"$encoding\" type=\"string\" required=\"false\" typeLink=\"/docs/php/types/string\">\n///     The character set.\n///   </Parameter>\n///   <ReturnType type=\"string\" typeLink=\"/docs/php/types/string\" />\n/// </Function>\nexport function html_entity_decode($string, $flags = null, $encoding = null) {\n    if (func_num_args() < 1) {\n        return null;\n    }\n\n    if (is_array($string) || is_object($string)) {\n        return null;\n    }\n\n    return __deka_html_unescape('' . $string);\n}\n","/__global/php_modules/string/html_utils.phpx":"import { __deka_slice_bytes, __deka_strlen_bytes } from './bytes_utils.phpx';\n\n/// docid: phpx/string/__deka_html_escape()\n/// <Function name=\"__deka_html_escape\">\n///   <Description>PHPX standard module function `__deka_html_escape` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_html_escape($value, $encodeQuotes = true, $doubleEncode = true) {\n    $input = '' . $value;\n    $len = __deka_strlen_bytes($input);\n    $out = '';\n    $i = 0;\n    while ($i < $len) {\n        $ch = $input[$i];\n        if ($ch === '&') {\n            if (!$doubleEncode && __deka_html_is_entity($input, $i, $len)) {\n                $out .= '&';\n                $i += 1;\n                continue;\n            }\n            $out .= '&amp;';\n            $i += 1;\n            continue;\n        }\n        if ($ch === '<') {\n            $out .= '&lt;';\n            $i += 1;\n            continue;\n        }\n        if ($ch === '>') {\n            $out .= '&gt;';\n            $i += 1;\n            continue;\n        }\n        if ($encodeQuotes) {\n            if ($ch === '\"') {\n                $out .= '&quot;';\n                $i += 1;\n                continue;\n            }\n            if ($ch === \"'\") {\n                $out .= '&#039;';\n                $i += 1;\n                continue;\n            }\n        }\n        $out .= $ch;\n        $i += 1;\n    }\n    return $out;\n}\n\n/// docid: phpx/string/__deka_html_unescape()\n/// <Function name=\"__deka_html_unescape\">\n///   <Description>PHPX standard module function `__deka_html_unescape` from `string`.</Description>\n///   <ReturnType type=\"mixed\" />\n/// </Function>\nexport function __deka_html_unescape($value) {\n    $input = '' . $value;\n    $len = __deka_strlen_bytes($input);\n    $out = '';\n    $i = 0;\n    while ($i < $len) {\n        if ($input[$i] !== '&') {\n            $out .= $input[$i];\n            $i += 1;\n            continue;\n        }\n\n        $match = __deka_html_match_entity($input, $i, $len);\n        if ($match['found']) {\n            $out .= $match['value'];\n            $i = $match['next'];\n            continue;\n        }\n        $out .= '&';\n        $i += 1;\n    }\n    return $out;\n}\n\nfunction __deka_html_is_entity($input, $start, $len) {\n    $end = $start + 1;\n    while ($end < $len && $input[$end] !== ';' && $end - $start <= 10) {\n        $end += 1;\n    }\n    if ($end >= $len || $input[$end] !== ';') {\n        return false;\n    }\n    $content = __deka_slice_bytes($input, $start + 1, $end);\n    if (__deka_strlen_bytes($content) === 0) {\n        return false;\n    }\n    if ($content[0] === '#') {\n        return true;\n    }\n    for ($i = 0; $i < __deka_strlen_bytes($content); $i += 1) {\n        $byte = ord($content[$i]);\n        if (!(($byte >= 48 && $byte <= 57) || ($byte >= 65 && $byte <= 90) || ($byte >= 97 && $byte <= 122))) {\n            return false;\n        }\n    }\n    return true;\n}\n\nfunction __deka_html_match_entity($input, $sta